import React, { Component } from 'react';
import PropTypes from 'prop-types';
import TodoSubList from './todosublist'
import "../App.css"

class TodoList extends Component {

    getStyle = () => {
        return {
            borderColor: 'green',
            border: '1px',
            borderstyle: 'solid',
            gridcolumn: '1 / 2',
        }
    }

    sublist() {
        return this.props.todolist.map((input) => (
            <TodoSubList key={input.id} todosublist={input} />
        ))
    }
    render() {
        return this.props.todolist.map((input) => (
            <div style={this.getStyle()} >
                {console.log(input.task)}
                {input.task}
                {input.dateB}
                {input.completed}
                {input.dateE}
            </div>
        ));
    }

}
TodoList.propTypes = {
    todolist: PropTypes.array.isRequired
}

export default TodoList;
